&lt;br /&gt;
&lt;b&gt;Lal Bagh (Kannada: ಲಾಲ್ ಬಾಗ್) or Lal Bagh Botanical Garden&lt;/b&gt; is a well known botanical garden in Bangalore (New name is Bengaluru), India The garden was commissioned by the ruler of Mysore, Hyder Ali. It has a famous glass house which hosts yearly flower show. It has an artistic structure named &lt;b&gt;&amp;quot;KempeGowda Tower&amp;quot; (as seen in these pictures)&lt;/b&gt;.  It also has an aquarium and a lake, and is one of the best tourist attractions in Bangalore.&lt;br /&gt;
&lt;br /&gt;
Source: Wikipedia.&lt;br /&gt;
&lt;br /&gt;
To know more about LalBagh, Please Visit &lt;a href="http://www.horticulture.kar.nic.in/lalbagh.htm" rel="nofollow"&gt;www.horticulture.kar.nic.in/lalbagh.htm&lt;/a&gt;&lt;br /&gt;
