&lt;p&gt;The Tickell's Blue Flycatcher (Cyornis tickelliae) is a small passerine bird in the flycatcher family. This is an insectivorous species which breeds in tropical southern Asia from India and Sri Lanka to Indonesia. They are blue on the upperparts and the throat and breast are rufous. They are found in dense scrub to forest habitats.&lt;/p&gt;

