&lt;p&gt;The Belur temple is situated in Karnataka, is known for its architectural marvel,where it contains 48 pillars.This pillar is situated in Belur Chennakeshava temple called as Narasimha Pillar. All the carvings and sculptures made around the temple is carved on this single  particular pillar in miniature form. Pillar is made up of soapstone using typical lathe process. The pillar was able to rotate on its axis with help of ball bearings. Though it may look like a circular pillar, a close look reveals that it is in fact polygonal with carvings positioned on each faces. There is small space left blank in the pillar which is clearly visible in the image which signifies, if any artist in the world who has the ability to challenge the architectural marvel of Belur carvings can carve on this blank space and show his talent. Till now its been left blank. The pillar base is cubical in shape. First of all the Belur temple is such a huge temple with so much of sculptures around it on each and every wall with finer details of the image. And accomodating so much of sculptures and images in this particular pillar in itself is a huge tremendous challenge and made it to rotate on its axis is itself is an ancient technology. The science used during those period without the use of equipments and sculpt it in a polygonal is absolute science and mathematics. The carvings on the pillars gives message to the society through sculptures. This is truely and an architectural marvel which has science, technology and an message to the society and the also the period when this was done spreads message of its rich culturual heritage to everyone till today.&lt;/p&gt;

