&lt;p&gt;The second youngster came along to take grooming lessons from mama. They share a dominance hierarchy which is linear. It means that there is an 'alpha' male who is the most dominant male of the troop, followed by a 'beta' male and 'gamma' and so on according to their dominance. Similarly for females also there is an 'alpha' female, 'beta' female 'gamma' female etc. The male and female hierarchies are different and of a non overlapping or non mixing type. Usually males are dominant over females, but this is not always so. The females have a stable dominance hierarchy, which changes very rarely, whilst the dominance hierarchy of males is very dynamic. In the male hierarchy there is always a competition to rise in rank with fights between close ranks common.&lt;br /&gt;
&lt;br /&gt;
Source: &lt;a href="http://en.wikipedia.org/wiki/Bonnet_macaque" rel="nofollow"&gt;Wikipedia&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/sandeepak/"&gt;SivamDesign&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/sandeepak/4662021634/" title="Mama's Care"&gt;&lt;img src="http://farm5.static.flickr.com/4051/4662021634_fe38ef9f3a_m.jpg" width="240" height="180" alt="Mama's Care" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Clicked these monkey's on the outskirts of the Mookambika Wildlife Sanctuary. Mama was busy grooming the little one when he spotted me.&lt;br /&gt;
&lt;br /&gt;
The Bonnet Macaques are endemic to southern India. They feed on fruits, nuts, seeds, flowers, invertebrates and cereals. In southern India this macaque exists as commensal to humans, feeding on food given by humans and raiding crops and houses. Can be a nuisance.&lt;/p&gt;

