&lt;p&gt;The Malabar Pied Hornbill flying in the Dandeli-Anshi wildlife sanctuary. The area opposite to the Nagjhari Power House is big hornbill country. A local told us about the old days when these hornbills were caught and killed for their meat – they were called Shahi Murga(royal chicken). Disgusting!&lt;br /&gt;
&lt;br /&gt;
This beautiful bird is now an endangered species.&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://shutterbug.nu/2010/02/malabar-pied-hornbill" rel="nofollow"&gt;shutterbug.nu/2010/02/malabar-pied-hornbill&lt;/a&gt;&lt;/p&gt;

