&lt;p&gt;&lt;a href="http://www.flickr.com/photos/nileshc/4823427307/" title="Sunset at Sykes Point"&gt;&lt;img src="http://farm5.static.flickr.com/4143/4823427307_1c965ce2bb_m.jpg" width="240" height="159" alt="Sunset at Sykes Point" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Here is a gorgeous sunset view of the Dandeli - Anshi Tiger Reserve forest. This is from a beautiful place called Sykes Point. The river you see below is the Kali river. If you wait long enough in the morning, you will see flocks of Malabar Pied Hornbills flying across the valley.&lt;br /&gt;
&lt;br /&gt;
This is my first attempt at an HDR photo. So if you are an HDR pro, excuse me if I have made any mistakes here. The sun flare could not be avoided, it is present in the original photos.&lt;br /&gt;
&lt;br /&gt;
&lt;a href="http://shutterbug.nu/2010/07/sykes-point" rel="nofollow"&gt;shutterbug.nu/2010/07/sykes-point&lt;/a&gt;&lt;/p&gt;

