&lt;p&gt;&lt;a href="http://www.flickr.com/photos/veeresh_ai/4823469553/" title="Made-my-day"&gt;&lt;img src="http://farm5.static.flickr.com/4114/4823469553_6946d1208c_m.jpg" width="160" height="240" alt="Made-my-day" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Most people tell me that you can't shoot candids when the subject becomes aware of you. I believe, candids are available every moment, humans are dependent on emotions for everything. Just gotta anticipate and wait. Here's what happened. A friend (Ashwin K S) was shooting this gentleman and had observed that Ashwin walks up to his subject and shows the photograph. So while Ashwin was busy shooting, I was busy composing and anticipating the emotion. This was the smile he gave Ashwin when he showed him the photograph :). And my day, well it was made, an awesome smile captured for ever! &lt;br /&gt;
&lt;br /&gt;
