&lt;p&gt;My latest trip has been to Dandeli wildlife santuary, in northern Karnataka. This place is a dense deciduous forest with a wide variety of bird and insect species. I have always like birds. Though, only recently have I seriously started understanding and reading about them, thanks to my photographer friends.&lt;br /&gt;
This photo was taken at the Timber Depot in Dandeli town. This place, among other places in the Dandeli sanctuary, is hot for spotting the Malabar Pied Hornbill, an exotic bird found generally in South East Asia.&lt;br /&gt;
