&lt;p&gt;Heeding good advice. Thanks for all you wonderful friends who have been so patient with my sporadic postings, catching up or the lack of it :) &lt;br /&gt;
&lt;br /&gt;
Broke my routine a bit today. Worked from 7.30am for a solid two hours. Then took a walk through my lovely neighborhood, camera in hand. The world at mid-morning is different from early mornings. Its a shame to be cooped up within four walls when there is so much beckoning!&lt;/p&gt;

