&lt;p&gt;Stepped Tank, part of Royal Enclosure at Hampi is another wonderful piece of art. This recently excavated stepped tank made out of black schist measuring about 22 meters in square and 7 meters deep is very ornate with 5 distinct tiers of steps. Each step is marked with its position and direction, may be because these steps were pre-fabricated and then assembled at this place or they intend to move it from place to place?&lt;/p&gt;

