&lt;p&gt;&lt;a href="http://www.flickr.com/photos/indiawaterportal/5077113355/" title="WATER! Our common wealth"&gt;&lt;img src="http://farm5.static.flickr.com/4125/5077113355_e9edd6543a_m.jpg" width="240" height="180" alt="WATER! Our common wealth" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Water! Water! Everywhere not a drop to drink…. This is what usually happens ….&lt;br /&gt;
 The above photos may be beautiful to look at, but have we ever thought about the scarcity of water….water scarcity is usually due to over exploitation and excessive use…. And this not only brings scarcity among human but also among different organisms on earth… water is a renewable resources but over use of water will bring a dramatic change …. there will be a day on earth where we can hardly see any water……and the scenery in the photo will no more exit….water is our common wealth and we need to save wealth.&lt;/p&gt;

