&lt;p&gt;Earth provides enough to satisfy every man's need; but not every man's greed. Don’t let this be the Last Drop.Water is Life, it is all pervasive. It is in water that we are born. We live with it.  And when we die we go in it. It is therefore, every ones duty that we respect each drop of WATER.If there is magic on this planet, it is contained in water. Water is life’s matter, its matrix, mother and medium. There is no life without it.&lt;/p&gt;

