&lt;p&gt;The environment is going away from humans day by day. The world is slipping. It reminds us that there is a need for call of immediate action. WHAT A WASTE. Let’s not waste it further. Let this be the last drop that we waste. Keep the environment green unlike this black and white image. The next new drop should be the drop of happy tears from people’s eyes.&lt;/p&gt;

