&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jk-dreamzone/5078104104/" title="Living on the edge..."&gt;&lt;img src="http://farm5.static.flickr.com/4125/5078104104_448804f8bb_m.jpg" width="167" height="240" alt="Living on the edge..." /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Life.. A four letter word.... And the biggest irony about life is that no one gets out of it alive.. Some go through life longer and some shorter.. Some life ends even before it begins and some lives just live in the hope of seeing a better tomorrow....&lt;br /&gt;
&lt;br /&gt;
Some live on the edge... the people who go to bed praying that they see the next day and death doesnt cheat them in sleep... the people who rely on small chemical modules to keep them breathing.. the people who pray that the ups and downs in the screen in front of them stay steady... the people who believe that they have the power and strength in them to see the next day..&lt;br /&gt;
&lt;br /&gt;
This picture is dedicated to all those people who have had the courage and the strength to challenge death, who outlived their diseases to see the tomorrows they dreamt of... to all the less fortunate people who had to wither sooner than they expected.... and to the people who rely on the magic of medicine...&lt;/p&gt;

