&lt;p&gt;&lt;a href="http://www.flickr.com/photos/lalitchetry/5089913092/" title="Mysore Palace, Mysore, India [+1 in comment]"&gt;&lt;img src="http://farm5.static.flickr.com/4145/5089913092_79b65d36a8_m.jpg" width="240" height="135" alt="Mysore Palace, Mysore, India [+1 in comment]" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;The Palace of Mysore (Kannada: ಮೈಸೂರು ಅರಮನೆ) is a palace situated in the city of Mysore in southern India. It is the official residence of the Wodeyars - the erstwhile royal family of Mysore, and also houses two durbar halls (ceremonial meeting hall of the royal court).&lt;br /&gt;
&lt;br /&gt;
Mysore has a number of historic palaces, and is commonly described as the City of Palaces. However, the term &amp;quot;Mysore Palace&amp;quot; specifically refers to one within the old fort. The palace was commissioned in 1897, and its construction was completed in 1912. It is now one of the most famous tourist attractions in Mysore.&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
The Kingdom of Mysore was ruled by the Wodeyar dynasty  from 1399 until the independence of India in 1947.The Wodeyar kings built a palace in Mysore in the 14th century, But the Raja Wodeyar shifted his Capital to the island fort town of Sriranagapattana in 1610 and Mysore lost its importance as a seat of power. But this palace was partially damaged by a lightning strike in 1638. It was repaired and expanded by Ranadhira Kanteerava Narasa Raja Wodeyar. With the usurpation of the Kingdom by the Hyder in 1762 Mysore Palace further lost its importance. But Hyder son , Tipu Sultan demolished the entire fort town including the Palace in 1787 and used the fort material to build a new town near by known as Nazarabad (now part of the mysore City). Fourth Mysore war in 1799 brought an end to the reign of Tipu sultan and then Governor General of India, Lord Mornington ( later Marquis Wellesley and elder brother of Arthur Wellesley - who rose to become Duke of Wellington and is famously known as Iron Duke) decided to restore part of the conquest to the ancient Hindu Royal family and shifted the capital of the newly defined territory of Mysore Kingdom to Mysore.&lt;br /&gt;
&lt;br /&gt;
Thus the scion of the Wodeyar, then five year old, Krishna Raja Wodeyar III was crowned as the new King in 1799 in a make shift premises within the destroyed fort. In due course the Nazrabad fort was dismantled an the material made its way back in building the Mysore fort once again. A new palace was built in its place by 1803. This palace was destroyed in a fire in 1897 during the wedding of Princess Jayalakshmanni.&lt;br /&gt;
&lt;br /&gt;
The regent of Mysore, Maharani Vani Vilas Sannidhna, commissioned a British architect, Henry Irwin, to build yet another palace in its place. The construction was completed in year 1912. But slowly the beautification of the fort was also taken up and the inhabitants of the fort were slowly shifted out to newer Extension built outside. The present Public Durbar Hall wing was also added much later around 1940. Now Its a Good Tourists attraction in South India&lt;br /&gt;
&lt;br /&gt;
Source : Wikipedia&lt;/p&gt;

