&lt;p&gt;This is a view from BR Hills near Mysore, Karnataka, India. The picture was taken during late afternoon. &lt;br /&gt;
&lt;br /&gt;
It was a cloudy, gloomy day. I was a little disappointed that the light wasn't well suited for shooting, and the atmosphere watered down my excitement (after all it's my first SLR and I had bought it the previous day, in hopes of exploiting this shooting opportunity).&lt;br /&gt;
&lt;br /&gt;
Fortunately, the clouds were clearing up now and then, late in the afternoon. And at times, some parts of the hills were lit very well and some were under the shade of dark clouds. The gloomy weather, the shade, the light - created something I hadn't expected before.&lt;br /&gt;
&lt;br /&gt;
An HDR-like image without HDR technique. I was ecstatic. :)&lt;/p&gt;

