&lt;p&gt;&lt;a href="http://www.flickr.com/photos/rsathya/5135173775/" title="Shivanasamudram (Bharachukki) Falls"&gt;&lt;img src="http://farm5.static.flickr.com/4043/5135173775_fc03f8bbdb_m.jpg" width="240" height="116" alt="Shivanasamudram (Bharachukki) Falls" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Blogged @ &lt;a href="http://rsathya.wordpress.com/2010/11/01/shivanasamudram-bharachukki-falls/" rel="nofollow"&gt;Like The Ocean&lt;/a&gt;&lt;br /&gt;
&lt;br /&gt;
This is one of the amazing falls @ 2-3 hrs drive from Bangalore. There are different names around this falls like Bluff, Shivanasamudram, Shivasamudram, Gaganachukki, Bharachukki. Mother Kaveri splits into two major branches creating Gaganachukki and Bharachukki falls. The below is that of Bharachukki , few kilometers to the south-west of the Gaganachukki falls. Even here, the falls is huge (roughly with a width of 850 mts). It is a beautiful panoramic view and with the full flow one can find different kinds of smaller falls. Like Jog falls, not sure if each of these have their own names :).  The center falls is very different in that it creates different levels before flowing and continuing down . To its left are couple of beautiful ones [not with too much of water] and lends itself for longer exposures even during early evenings (as it would be in shade :) ). Onto the right, the rock formation tends to create multiple stepped falls with the right amount of water [will post this some time in future !!!] .&lt;br /&gt;
&lt;br /&gt;
Some suggest to get to the falls before noon as the light would directly be falling on the falls. But for me it is always the dreamy effect and the dusk light that creates the magic.&lt;br /&gt;
&lt;br /&gt;
It is also significant to note that the Asia's fist hydro electric project was started here in the beginning of the century(1902).&lt;/p&gt;

