&lt;p&gt;&lt;a href="http://www.flickr.com/people/manumint/"&gt;manumint&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/manumint/5211334584/" title="HAMPI"&gt;&lt;img src="http://farm5.static.flickr.com/4104/5211334584_b6307923f0_m.jpg" width="177" height="240" alt="HAMPI" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;b&gt;Hampi&lt;/b&gt; in Karnataka state of India is the site of the once-magnificent capital of the Vijayanagar Empire. &lt;u&gt;The ruins are a UNESCO World Heritage site now.&lt;/u&gt;. Hampi was the capital of Vijayanagar(14th century empire). The ruins of the empire is spread over the area of 26 sq km.&lt;br /&gt;
&lt;br /&gt;
Hampi is well worth the visit. The area is simply stunning and you will be in awe of the millions of boulders surrounding the area. However, within this arid landscape lies a little oasis with lush palm, banana, and mango trees nestled near the river. Hampi is a great place to spend a few days wandering around and discovering the rich, vibrant history while also having a bit of 'your' time.&lt;br /&gt;
&lt;br /&gt;
Hampi is undoubtedly one of the best place i've traveled this year and i really looking forward to visit this exotic place again in future.&lt;/p&gt;

